import React, { Component } from 'react';
import './assets/navbar.css';

class Navbar extends Component{
    render() {
        return(
            <div className = "navbar-cover">
                <div className = "container text-center">
                    <nav>
                        <ul>
                            <li>Home</li>
                            <li>About Me</li>
                            <li>Skills</li>
                            <li>Projects</li>
                            <li>Contact Me</li>
                        </ul>
                    </nav>
                </div><br/>
                

                <div>

                </div>
            </div>
        );
    }
}

export default Navbar;
